import './App.css';
import Customer from './components/Customer';

const customer = {
  'name' : '김태희',
  'birthday' : '931018',
  'gender' : '남자',
  'job' : '개발'

}

function App() {
  return (
    <Customer
      name={customer.name}
      birthday={customer.birthday}
      gender={customer.gender}
      job = {customer.job}
    />
  );
}

export default App;
